import { useState, useEffect } from "react"
import '../App.css';

export default function DataList() {
    
    const [data, setData] = useState([])

    useEffect(() => {
        fetch("http://localhost:8800/")
          .then((response) => response.json())
          .then((data) => {
            setData(data);
          });
    }, []);

    async function handleAdd() { 
        const promise = await fetch('http://localhost:8800/', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                nome: 'Teste',
                idade: 20,
                cpf: '123.456.789-00'
            })
        })
    }

    async function handleDelete(id) { 
        const promise = await fetch(`http://localhost:8800/${id}`, {
            method: 'DELETE'
        })
        const response = await promise.json()
        console.log(response)
    }

    async function handleEdit(id) {
        const promise = await fetch(`http://localhost:8800/${id}`, {
            method: 'PUT'
        })
        const response = await promise.json()
        console.log(response)
    }
    
    return (
        <div>
            <div className="data-list">
                
                {data.map((item) => (
                    <div className="list-item"  key={item.idusuarios}>
                        <span className="item">{item.idusuarios}</span>
                        <span className="item">{item.nome}</span>
                        <span className="item">{item.idade}</span>
                        <span className="item">{item.cpf}</span>
                        <button className="edit-btn" type="button">Editar</button>
                        <button className="del-btn" type="button">Deletar</button>
                    </div>
                ))}
                    
            </div>
        </div>
    )
}
